import React from 'react';
import { useLocation } from 'react-router-dom';
import Draw from "/Users/gizem/Desktop/reactproje/src/common/drawer.js"
import Task from '../components/task';
const Home = () => {
    const { state } = useLocation();
    const userData = state?.userData;

    return (
        <div>

            <Draw userData={userData}></Draw>

            <Task userData={userData}></Task>

        </div>
    );
};

export default Home;
